('1733','2','2111','Wohnung Sa marina Son Gual II',Null,'3- und 4-Schlafzimmer-Wohnungen am Golfplatz Son Gual','20723','Nur 11 km von Palma entfernt, liegt die Wohnanlage Sa Marina de Son Gual, auf einem kleinen Hügel mit Blick über den gleichnamigen 18-Loch Golfplatz Son Gual und auf Palma.\r\nDie Wohnanlage bietet im Außenbereich zwei mit großzügigen Rasenflächen umgebene Gemeinschaftspools, einen Street-Basketballplatz, Paddle-Tennis-Courts und ein Kinderspielplatz.\r\nDie Wohnungen sind unmöbliert. Momentan sind noch folgende Apartments frei:\r\n- Wohnfläche 142 m², 4 Schlafzimmer, 3 Bäder, Monatsmietpreis 680 EUR\r\n- Wohnfläche 142 m², 4 Schlafzimmer, 3 Bäder, Monatsmietpreis 720 EUR\r\n- Erdgeschoss-Wohnung mit Garten, Wfl. 136 m², 3 SZ, 3 Bäder, Monatsmietpreis 700 EUR\r\n- Erdgeschoss-Wohnung mit Garten, Wfl. 119 m², 3 SZ, 2 Bäder, Monatsmietpreis 630 EUR\r\n- 3 Wohnungen, je 119 m² Wohnfläche, 3 SZ, 2 Bäder, Monatsmietpreis 540 - 620 EUR\r\nDie Mietkonditionen können Sie bei uns im Büro erfahren oder wir senden sie Ihnen gerne per E-Mail zu.','20724','850','111','2012-02-01 12:44:05','1','2012-02-01 12:48:35',Null,'1291','158','634',1,'1','1100',Null,Null,'auf Anfrage','20725',Null,'0','0','0',Null,'2015-04-07 09:24:50',1,'0',Null,Null,Null,Null,'5',1,1,0,'0','0','1',1,1,Null,'20726',Null,'20727',Null,'20728',Null,'20729',Null,Null,'20730','0',0);
